import styles from "./NavLanding.module.css";
import React, { useState, useEffect } from "react";

const NavLanding = () => {
  return (
    <div className={styles.container}>
      <ul className={styles.optionList}>
        <li>Omatic</li>
        <div>
          <li>
            <a
              href="https://twitter.com/MekaVerse"
              name="twitternav"
              rel="noopener"
              target="_blank"
              class="twitter row"
            ></a>
          </li>
          <li> Discord</li>
        </div>
      </ul>
    </div>
  );
};

export default NavLanding;
